import React, {Component} from "react";

export class DigitalTime extends Component {
  constructor(props) {
    super(props);
    this.state = {
      time: "",
    };
  }

  render() {
    return (
      <>
        <h1>{this.state.time}</h1>
      </>
    );
  }
}

export default DigitalTime;
